public class InnerDeploymentDeploymentPoliciesFactory(Action<Humidifier.GreengrassV2.DeploymentTypes.DeploymentPolicies> factoryAction = null) : SubResourceFactory<Humidifier.GreengrassV2.DeploymentTypes.DeploymentPolicies>
{

    internal InnerDeploymentDeploymentComponentUpdatePolicyFactory ComponentUpdatePolicyFactory { get; set; }

    internal InnerDeploymentDeploymentConfigurationValidationPolicyFactory ConfigurationValidationPolicyFactory { get; set; }

    protected override Humidifier.GreengrassV2.DeploymentTypes.DeploymentPolicies Create()
    {
        var deploymentPoliciesResult = CreateDeploymentPolicies();
        factoryAction?.Invoke(deploymentPoliciesResult);

        return deploymentPoliciesResult;
    }

    private Humidifier.GreengrassV2.DeploymentTypes.DeploymentPolicies CreateDeploymentPolicies()
    {
        var deploymentPoliciesResult = new Humidifier.GreengrassV2.DeploymentTypes.DeploymentPolicies();

        return deploymentPoliciesResult;
    }
    public override void CreateChildren(Humidifier.GreengrassV2.DeploymentTypes.DeploymentPolicies result)
    {
        base.CreateChildren(result);

        result.ComponentUpdatePolicy ??= ComponentUpdatePolicyFactory?.Build();
        result.ConfigurationValidationPolicy ??= ConfigurationValidationPolicyFactory?.Build();
    }

} // End Of Class

